pragma solidity >=0.5.6 <0.6.2;
pragma experimental ABIEncoderV2;

import "./token.sol";

contract Entities {
    address private owner;
    address private token;

    struct Etablisement {
        string Nom_Etablisement;
        string Type;
        string Pays;
        string Adresse;
        string Site_Web;
        uint256 ID_Agent;
    }

    struct Diplome {
        uint256 ID_Titulaire;
        string Nom_Etablisement_Enseignement_Superieur;
        uint256 ID_EES;
        string Pays;
        string Type_Diplome;
        string Specialite;
        string Mention;
        uint256 Date_d_obtention;
    }

    struct Etudiant {
        string Nom;
        string Prenom;
        string Date_de_naisance;
        string Sexe;
        string Nationalite;
        string Statut_civil;
        string Adresse;
        string Courriel;
        string Telephone;
        string Section;
        string Sujet_PFE;
        string Entreprise_Stage_PFE;
        string NomPrenom_MaitreDuStage;
        uint256 Date_debut_stage;
        uint256 Date_fin_stage;
        string Evaluation;
    }

    struct Entreprise {
        string Nom;
        string Secteur;
        uint256 Date_Creation;
        string Classification_Taille;
        string Pays;
        string Adresse;
        string Courriel;
        string telephone;
        string Site_Web;
    }

    mapping(uint256 => Etablisement) public Etablisements;
    mapping(address => uint256) AddressEtablisements;
    mapping(uint256 => Etudiant) Etudiants;
    mapping(uint256 => Entreprise) public Entreprises;
    mapping(address => uint256) public AddressEntreprises;
    mapping(uint256 => Diplome) public Diplomes;

    function get_Etudiants(uint256 id) public view returns (Etudiant memory) {
        return Etudiants[id];
    }

    uint256 public NbEtablisements;
    uint256 public NbEtudiants;
    uint256 public NbEntreprises;
    uint256 public NbDiplomes;

    constructor(address tokenaddress) public {
        token = tokenaddress;
        owner = msg.sender;

        NbEtablisements = 0;
        NbEtudiants = 0;
        NbEntreprises = 0;
        NbDiplomes = 0;
    }

    function ajouter_etablisement(Etablisement memory e, address a) private {
        NbEtablisements += 1;
        Etablisements[NbEtablisements] = e;
        AddressEtablisements[a] = NbEtablisements;
    }

    function ajouter_entreprise(Entreprise memory e, address a) private {
        NbEntreprises += 1;
        Entreprises[NbEntreprises] = e;
        AddressEntreprises[a] = NbEntreprises;
    }

    function ajouter_etudiant(Etudiant memory e) private {
        NbEtudiants += 1;
        Etudiants[NbEtudiants] = e;
    }

    function ajouter_diplome(Diplome memory d) private {
        NbDiplomes += 1;
        Diplomes[NbDiplomes] = d;
    }

    function ajouter_etablisement(string memory Nom) public {
        Etablisement memory e;
        e.Nom_Etablisement = Nom;
        ajouter_etablisement(e, msg.sender);
    }

    function ajouter_entreprise(string memory Nom) public {
        Entreprise memory e;
        e.Nom = Nom;
        ajouter_entreprise(e, msg.sender);
    }

    function ajouter_etudiant(string memory Nom, string memory Prenom) public {
        uint256 id = AddressEtablisements[msg.sender];
        require(id != 0, "not etablisement");
        Etudiant memory e;
        e.Nom = Nom;
        e.Prenom = Prenom;
        ajouter_etudiant(e);
    }

    function ajouter_diplome(uint256 ID_Titulaire) public {
        uint256 id = AddressEtablisements[msg.sender];
        require(id != 0, "not etablisement");
        Etudiant memory student = Etudiants[ID_Titulaire];
        require(bytes(student.Nom).length != 0, "Student doesn't exist");
        Diplome memory d;
        d.ID_Titulaire = ID_Titulaire;
        d.Nom_Etablisement_Enseignement_Superieur = Etablisements[id].Nom_Etablisement;
        ajouter_diplome(d);
    }

    function evaluer(
        uint256 EtudiantID,
        string memory Sujet_PFE,
        string memory Entreprise_Stage_PFE,
        string memory NomPrenom_MaitreDuStage,
        uint256 Date_debut_stage,
        uint256 Date_fin_stage,
        string memory Evaluation
    ) public {
        uint256 id = AddressEntreprises[msg.sender];
        require(id != 0, "no Entreprises");
        Etudiants[EtudiantID].Sujet_PFE = Sujet_PFE;
        Etudiants[EtudiantID].Entreprise_Stage_PFE = Entreprise_Stage_PFE;
        Etudiants[EtudiantID].NomPrenom_MaitreDuStage = NomPrenom_MaitreDuStage;
        Etudiants[EtudiantID].Date_debut_stage = Date_debut_stage;
        Etudiants[EtudiantID].Date_fin_stage = Date_fin_stage;
        Etudiants[EtudiantID].Evaluation = Evaluation;
        require(
            MyToken(token).allowance(owner, address(this)) >= 15,
            "token not allowed"
        );
        require(
            MyToken(token).transferFrom(owner, msg.sender, 15),
            "transfert fail"
        );
    }

    event verifierresult(Diplome);

    function verifier(uint256 DiplomeID) public returns (Diplome memory) {
        require(
            MyToken(token).allowance(msg.sender, address(this)) >= 10,
            "token not allowed"
        );
        require(
            MyToken(token).transferFrom(msg.sender, owner, 10),
            "transfert fail"
        );
        return Diplomes[DiplomeID];
    }
}

contract/token.sol.content:
pragma solidity >=0.5.0 <0.6.2;

abstract contract ERC20Basic {
    event Transfer(address indexed _from, address indexed _to, uint256 _value); 
    event Approval(address indexed _owner, address indexed _spender, uint256 _value);


    function totalSupply() public view virtual returns (uint256); 
    function balanceOf(address who) public view virtual returns (uint256); 
    function transfer(address to, uint256 value) public virtual returns (bool);
    function transferFrom(address from, address to, uint256 value) public virtual  returns (bool) {} 
    function approve(address spender, uint256 value) public virtual returns (bool);
    function allowance(address owner, address spender) public view virtual returns (uint256);
 
}

contract StandardToken is ERC20Basic{
    mapping(address => uint256) public _balances;
    mapping(address => mapping(address => uint256)) internal _allowed;
    uint256 public _totalSupply;

    event Transfer(address _addr, address _to, uint256 _value);
    event Approval(address _owner, address _spender, uint256 _value);

    function totalSupply()public view override returns(uint256){
        return _totalSupply;
    }
    function balanceOf(address who) public view override returns(uint256){
        return _balances[who];
    }

    function transfer(address to, uint256 value)public override returns (bool){
        require(_balances[msg.sender] >= value, "Insufficient balance");
        _balances[msg.sender] -= value;
        _balances[to] += value;  
        emit Transfer(msg.sender, to, value);
        return true;
    }

    function transferFrom(address from, address to, uint256 value) public override returns (bool) {
        require(value <= _balances[from], "Insufficient balance");
        require(value <= _allowed[from][msg.sender], "You arent allowed to this amount");
      
        _balances[from] -= value;//
        _balances[to] += value;  
        _allowed[from][msg.sender]-=value;
        emit Transfer(from, to, value);
        return true;
    } 

    function approve(address spender, uint256 value) public override returns (bool){
        require(_allowed[msg.sender][spender] == 0, "You arent allowed to spend");
        _allowed[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256){
        return _allowed[owner][spender];
    }

}

contract MyToken is StandardToken {
    string public _name;
    string public _symbol;
    uint32 public _decimals;
    mapping (address => mapping (address => uint256)) private _allowances;
    mapping (address => bool) private _entreprises;
    uint256 public constant etherRate = 100;
    uint256 public constant verificationCosts = 10;
    uint256 public constant evaluationCosts = 15;

    constructor( )public{
        _name="schoolToken";
        _symbol="ST";
        _decimals=0;
        _totalSupply=1000;
        _balances[msg.sender]=_totalSupply;
    }
    
    function acheterTokens(uint256 nbToken) public payable {
        require(nbToken > 0, "Le montant envoyé doit être supérieur à 0");
        uint256 amount = nbToken * etherRate;
        require(amount <= _totalSupply - _balances[msg.sender], "La vente est terminée");
        _balances[msg.sender] += amount;
        _balances[address(this)] -= amount;
        emit Transfer(address(this), msg.sender, amount);
    }
}
